import React from 'react';
import { Grid } from '@material-ui/core';
import StepperList from '../components/StepperList';

const MainPage = () => {
    return (
        <Grid container direction="column" justify="center" alignItems="center" spacing={2}>
            <Grid item>
                <StepperList />
            </Grid>
        </Grid>
    );
}

export default MainPage;
